    false,nt"url": null,nt"notes": "This inventory and monitoring plan (IMP)
    documents the inventory and monitoring surveys that will be conducted at Port Louisa
    National Wildlife Refuge (NWR) from 2016 through 2031, or until the refugeu2019s
    Comprehensive Conservation Plan (CCP) and Habitat Management Plan (HMP) are revised.
    The majority of surveys considered in this plan address resource management objectives
    identified in the HMP (2015) for this refuge. Other surveys are a continuation of
    past monitoring conducted for the purpose of understanding long-term trends in specific
    resources or are part of regional and national survey efforts. This IMP was developed
    according to the Inventory and Monitoring (I&M) policy (701 FW 2) for the National
    Wildlife Refuge System.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
